import React from 'react';
import Display from './Display';

const ButtonNumber = ({number}) => {

    setDisplay = () => {
        Display.setState({
            value: {number}
        });
    };

    return(
    <button onClick={this.setDisplay}>{number}</button>
    );
};

export default ButtonNumber;

